import { Routes } from '@angular/router';
import { AccesibilityAgreementPageComponent } from './accesibility-agreement-page/accesibility-agreement-page.component';
import { HomePageComponent } from './home-page/home-page.component';
import { PrivacyPageComponent } from './privacy-page/privacy-page.component';
import { ShowcasePageComponent } from './showcase-page/showcase-page.component';
import { TermsPageComponent } from './terms-page/terms-page.component';

export const routes: Routes = [
    {
      path: 'home',
      component: HomePageComponent
    },
    {
      path: 'showcase',
      component: ShowcasePageComponent
    },
    {
        path: 'privacy_policy',
        component: PrivacyPageComponent
    },
    {
        path: 'terms_of_service',
        component: TermsPageComponent
    },
    {
        path: 'accessibility_statement',
        component: AccesibilityAgreementPageComponent
    },
    // {
    //       path: 'showcase',
    //       component: ShowcasePageComponent
    // },

    {
      path: '',
      redirectTo: 'home',
      pathMatch: 'full'
    }
  ];
